class Submission:
    def __init__(self, submission_id, data):
        self.submission_id = submission_id
        self.data = data
        self.status = "Pending"

    def update_status(self, new_status):
        self.status = new_status


class SubmissionSystem:
    def __init__(self):
        self.submissions = {}
        self.current_id = 1

    def submit_data(self, data):
        if not self.validate_submission(data):
            return "Validation failed. Submission not created."
        submission = Submission(self.current_id, data)
        self.submissions[self.current_id] = submission
        self.current_id += 1
        return f"Submission created with ID: {submission.submission_id}"

    def view_status(self, submission_id):
        submission = self.submissions.get(submission_id)
        if submission:
            return f"Submission ID: {submission.submission_id}, Status: {submission.status}"
        return "Error: Submission not found."

    def update_status(self, submission_id, new_status):
        submission = self.submissions.get(submission_id)
        if submission:
            submission.update_status(new_status)
            return f"Submission ID: {submission.submission_id} status updated to {new_status}."
        return "Error: Submission not found."

    def validate_submission(self, data):
        if isinstance(data, str) and len(data) > 0:
            return True
        return False

    def delete_submission(self, submission_id):
        if submission_id in self.submissions:
            del self.submissions[submission_id]
            return f"Submission ID: {submission_id} deleted successfully."
        return "Error: Submission not found."


class Tester:
    def __init__(self):
        self.issues = []

    def track_issue(self, issue):
        self.issues.append(issue)

    def generate_summary(self):
        if not self.issues:
            return "No issues encountered during testing."
        return f"Summary of issues encountered:\n" + "\n".join(self.issues)


# Example usage
submission_system = SubmissionSystem()
tester = Tester()

# User submits data
print(submission_system.submit_data("My submission data"))
print(submission_system.submit_data(""))  # Invalid submission

# User views submission status
print(submission_system.view_status(1))
print(submission_system.view_status(2))  # Non-existent submission

# User updates submission status
print(submission_system.update_status(1, "In Progress"))
print(submission_system.update_status(2, "Completed"))  # Non-existent submission

# User deletes a submission
print(submission_system.delete_submission(1))
print(submission_system.delete_submission(1))  # Non-existent submission

# Tester tracks issues
tester.track_issue("Submission validation check failed")
tester.track_issue("Submission not found error handled")

# Tester generates summary
print(tester.generate_summary())
